import React from "react";
import './cnt.css';


const Main =() => {
    return(
        <div className="cnt_wrap">
            <div className="cnt">
                <div className="cnt_tit">메인페이지입니다.</div>
                <div className="tit_line"></div>
                <div className="cnt_sub_tit">서브타이틀</div>
                <div className="cnt_sec">
                    페이지전환0
                </div>
            </div>
        </div>
    )
    
}

export default Main;
